function $se(a){$De(a.f,'Welcome! Press enter to get started!');$De(a.f,'Quicksort is among the fastest sorting algorithms');$De(a.f,"The first step of Quicksort is to 'partition' the array.");$De(a.f,'To partition, we select some pivot element within the array.');$De(a.f,'Different quicksort variants choose the pivot differently.');$De(a.f,"We'll just use the middle element.");$De(a.f,Vnf);$De(a.f,'Click on the middle element to make it the pivot.');$De(a.f,'Now, the purple element is our pivot.');$De(a.f,'Our goal is to figure something out about the pivot...');$De(a.f,"We want to figure out it's correct place in the sorted array.");$De(a.f,'So, the center might be the wrong (sorted) pivot spot...');$De(a.f,"We can figure out the pivot's correct spot by 'partitioning'.");$De(a.f,"So, what exactly is 'partitoning the array'?");$De(a.f,"Well, basically it's re-arranging elements based on the pivot.");$De(a.f,'We want elements smaller than the pivot to the left...');$De(a.f,'...and we want elements bigger than pivot to the right.');$De(a.f,'Before partitioning, we need to move the pivot out of the way.');$De(a.f,"Basically, we're hiding the pivot until we know where it goes.");$De(a.f,'Different quicksort variants hide the pivot in different ways...');$De(a.f,"We'll just tuck it away at the start of our array sequence.");$De(a.f,Wnf);$De(a.f,'Drag the pivot to the first element, and release to swap.');$De(a.f,"So, the pivot's hidden -- but what are those arrow 'pointers'?");$De(a.f,'The pointers are our place holders while we partition.');$De(a.f,'In regards to their colors...');$De(a.f,"Let's say that anything 'red' is 'smaller' than the pivot...");$De(a.f,'...and anything blue is bigger than the pivot.');$De(a.f,'So: red = smaller; blue = bigger.');$De(a.f,"Now, we're going to 'color-code' elements based on size");$De(a.f,"Let's move red pointer right marking red (smaller) elements");$De(a.f,Xnf);$De(a.f,'Like that!');$De(a.f,'The next element is also smaller than the pivot...');$De(a.f,'...since it is smaller, it should be red too.');$De(a.f,Xnf);$De(a.f,Ynf);$De(a.f,'You try, click the next element to color code it.');$De(a.f,"But don't actually think of this as color coding...");$De(a.f,"What we're really doing is sliding the red pointer.");$De(a.f,"We're sliding it passed smaller elements...");$De(a.f,'...searching for a larger element.');$De(a.f,"The red pointer's element is larger than the purple pivot...");$De(a.f,'Since it is larger, we should label it blue.');$De(a.f,Znf);$De(a.f,'Continue clicking on the element until it is blue.');$De(a.f,"Here's where we change things up...");$De(a.f,'...now we want to slide the blue pointer passed larger elements.');$De(a.f,"Essentially, it's looking for a smaller-than-pivot element");$De(a.f,'Since the element at the blue pointer is larger...');$De(a.f,$nf);$De(a.f,'... it needs to be blue; please change its color to blue.');$De(a.f,'Now the blue pointer has found a smaller element!');$De(a.f,_nf);$De(a.f,'Please label it red, since it is smaller than the pivot.');$De(a.f,"The moment we've been waiting for! ...");$De(a.f,'...the two pointers have found their targets.');$De(a.f,'The next step is to swap the elements at the two pointers! ');$De(a.f,'Swapping corrects the relative position of the elements...');$De(a.f,"...we're trying to get all red on the left, and all blue on the right.");$De(a.f,aof);$De(a.f,"Swap the two pointer's elements (click and drag).");$De(a.f,'Did you notice the pointers update?');$De(a.f,'The red pointer moved right, the blue moved left.');$De(a.f,'Now what? Well, in this case we re-position the pivot.');$De(a.f,'But normally, we will repeat blue and red pointer scanning.');$De(a.f,'Normally, we scan again until the pointers cross.');$De(a.f,'But only when the pointers cross each other...');$De(a.f,'...do we reposition the pivot into the array.');$De(a.f,'Now then, since our pointers crossed over each other...');$De(a.f,"...we're ready to position the pivot!");$De(a.f,"We need to swap the pivot into it's correct place...");$De(a.f,'...and the correct place is at one of the pointers.');$De(a.f,'Can you guess which pointer we will swap with the pivot?');$De(a.f,'Since we want all red on the left, and all blue on the right...');$De(a.f,'We will swap with red element currently at the blue pointer...');$De(a.f,'We do this because we hid the pivot on the left (red) side.');$De(a.f,bof);$De(a.f,'Swap the pivot with the blue pointer element, please.');$De(a.f,"We've now completed our first partition!");$De(a.f,'Quicksort is a recursive algorithm, ...');$De(a.f,'... which means we recurse(repeat) on smaller subproblems');$De(a.f,'In this case, we have two smaller subproblems, ...');$De(a.f,'...our two subproblems are beside our last pivot!');$De(a.f,"So, let's repeat and partition on both sides of the old pivot.");$De(a.f,'Starting with the left half, we need a pivot.');$De(a.f,'When there are two middle elements, choose the left.');$De(a.f,Vnf);$De(a.f,'Above the left gray bar, pick the pivot (middle) element.');$De(a.f,'Now we need to hide the pivot again...');$De(a.f,"... we're going to hide it to the far left again.");$De(a.f,"It may seem like we're always hiding it in the leftmost spot...");$De(a.f,'...but we can only hide it within the current subproblem...');$De(a.f,'... which means always hide the pivot within the gray bar');$De(a.f,Wnf);$De(a.f,'Now, hide the pivot on the far left (swap).');$De(a.f,'Now we need to label elements red again...');$De(a.f,'... the first scan always starts at the red pointer...');$De(a.f,'we mark elements red until reaching a bigger element');$De(a.f,Znf);$De(a.f,'Scan over all the red elements, and mark the last one blue.');$De(a.f,'Nice! now time to start our left scan...');$De(a.f,'The second scan always starts at the blue pointer...');$De(a.f,'...and moves left, marking blue elements...');$De(a.f,'...until it reaches a red element.');$De(a.f,_nf);$De(a.f,'From blue pointer, label larger elements blue.');$De(a.f,"This time we don't need to swap the pointers...");$De(a.f,'...the blue pointer has already passed the red pointer');$De(a.f,'When our pointers cross places, it is time to position the pivot.');$De(a.f,'Remember, every time move the pivot out of hiding...');$De(a.f,'...we move it to the spot of the blue pointer.');$De(a.f,bof);$De(a.f,'Now then, correctly position pivot into the subproblem.');$De(a.f,'We just completed another partitioning...');$De(a.f,'...which means we are done with this subproblem.');$De(a.f,'notice our new pivot split the region into two halves.');$De(a.f,'Now we need to pick a pivot one of these subproblems.');$De(a.f,'Notice the gray underline only covers 1 element.');$De(a.f,'This means we have a subproblem size of 1.');$De(a.f,'So, we only have 1 element to pick a pivot from...');$De(a.f,'...which means this element is already correctly positioned!');$De(a.f,'This is what we call a base case...');$De(a.f,'Base cases are essentially the end the of recursion.');$De(a.f,cof);$De(a.f,'Please click the one element to label purple.');$De(a.f,'Now we only have two elements above the gray bar...');$De(a.f,'...which is another base case!');$De(a.f,"Again, we don't need to recursively partition anymore.");$De(a.f,"We only need to swap the two if they're out of order.");$De(a.f,cof);$De(a.f,"Since these two are out of order, let's swap the elements..");$De(a.f,"Again we're presented with the two element base case.");$De(a.f,cof);$De(a.f,"They're out of order, so let's swap.");$De(a.f,'And we have it, the entire array has been sorted!');$De(a.f,"Now that you've seen the basics...");$De(a.f,"...you're ready to try some more challenging arrays.");$De(a.f,"If you get stuck, press 'enter' to see the next step...");$De(a.f,'I suggest letting the computer solve the first one...');$De(a.f,'...it may help to see how it is done quickly.');$De(a.f,'But after a few, try to solve the steps on your own.');$De(a.f,"Press 'space' at anytime to see keyboard shortcuts.");$De(a.f,"Now, press 'N' for a normal array, or 'B' for a big array.")}
